import React from "react";
import Projects from "./Projects";
import { Container } from "semantic-ui-react";
import "./style.css";

const Portfolio = () => (
  <div>
    <Container className="portfolio">
      <h1 className="portTitle">PORTFOLIO</h1>
      <Projects />
    </Container>
  </div>
);

export default Portfolio;
